export interface Population {
    id: number;
    country: string;
    year: number;
    totalMale: string;
    totalFemale: string;
}




export function fetchData(s: any, x: any, d: any): Promise<Population[]> {
    const dataUrl =
        "https://localhost:7185/Population";
    return fetch(dataUrl)
        .then((r) => r.json())
}
